import React from "react";
import "./styles.css";

export default function App() {
  return <Button color="blue" disable={true} text="knopf lol" />;
}

function Button(props) {
  return (
    <button color={props.color} disabled={props.disable}>
      {props.text}
    </button>
  );
}
